import "./List.css"
import Header from "../../components/header/Header.jsx";
import Navbar from "../../components/navbar/Nabvar.jsx";
import { useLocation } from "react-router-dom";
import { useState } from "react";
import { format } from "date-fns";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { setHours, setMinutes } from "date-fns";
import SearchItem from "../../components/searchItem/SearchItem";


const List = () => {

    const location = useLocation()
    const [busqueda, setBusqueda] = useState(location.state.busqueda)
    const [startDate, setStartDate] = useState(location.state.startDate)

    const [openDate, setOpenDate] = useState(false)

    const { data, loading, error, refetch } = useFecth();

    return (
        <div> 
            <Navbar/>
            <Header type="list" />
            <div className="listContainer">
                <div className="listWrapper">
                    <div className="listSearch">
                        <h1 className="lsTitle">Búsqueda</h1>
                        <div className="lsItem">
                            <label >¿Qué necesitas encontrar?</label>
                            <input placeholder={busqueda} type="text" />
                        </div>
                        <div className="lsItem">
                            <label >¿Cuándo lo necesitas?</label>
                            <span onClick={()=>setOpenDate(!openDate)}>
                                { `${format(startDate, "MMMM d, yyyy h:mm aa")}`}
                            </span>
                            {openDate && ( 
                                <DatePicker
                                    selected={startDate}
                                    onChange={(date) => setStartDate(date)}
                                    showTimeSelect
                                    inline
                                    minTime={setHours(setMinutes(new Date(), 0), 7)}
                                    maxTime={setHours(setMinutes(new Date(), 0), 20)}
                                    dateFormat="MMMM d, yyyy h:mm aa"
                                    className="date"
                                /> 
                            )}
                        </div>
                        <button>Buscar</button>
                    </div>
                    <div className="listResult">
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                        <SearchItem/>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default List
